import news_loading from '../icons/news_loading.webp';
import '../App.css';

function News_loading() {

    return (
        <div className="App">
          <header className="App-header">
            <img src={news_loading} className="App-logo" alt="logo" />
          </header> 
        </div> 
    );  

}
export default News_loading;
